    "ALLP.text.asiamiles.balance": cc11001100_hook("ALLP.text.asiamiles.balance", "「亚洲万里通」里数余额", "object-key-init"),
    "ALLP.text.asiaMiles.overlayText": cc11001100_hook("ALLP.text.asiaMiles.overlayText", "「亚洲万里通」是亚洲引领时尚的旅游及休闲奖励计划，为您带来琳琅满目的精彩奖励，配合您独特的生活品味。您可搭乘国泰航空等 25 家「亚洲万里通」伙伴航空公司的航班，累积「亚洲万里通」里程用于兑换航班奖励、升级、旅伴机票和其他时尚生活品味奖励。轻松愉悦累积「亚洲万里通」里数。", "object-key-init"),
    "ALLP.text.asiaMiles.overview": cc11001100_hook("ALLP.text.asiaMiles.overview", "概览", "object-key-init"),
