    "ALLP.text.asiaMiles.whtForMeText": cc11001100_hook("ALLP.text.asiaMiles.whtForMeText", "<p>使用您的信用卡或手机，每天累积里数。从旅行、酒店、餐饮、交通到其他活动，均可以为您轻松累积里程。</p>\n<p>如果您还不是会员，<a href=\"https://www.asiamiles.com/am/sc/about/join\" target=\"_blank\">立即加入</a>享受更多「亚洲万里通」会籍礼遇。</p>\n<p>您可以累积的固定「亚洲万里通」里数是根据以下所显示计算方法以航程长度和票价类别所得。</p>", "object-key-init"),
