    "CLUP.text.Baggage.BagAllw": cc11001100_hook("CLUP.text.Baggage.BagAllw", "行李限额", "object-key-init"),
    "CLUP.text.Baggage.Note": cc11001100_hook("CLUP.text.Baggage.Note", "<p>您的行李限额视乎旅程目的地及马可孛罗会级别而定。需支付额外行李费用。<a href=\"http://www.cathaypacific.com/cx/sc_CN/travel-information/baggage.html\" target=\"_blank\">在此处查看行李信息。</a>可通过此步骤后的概要查阅行李限额的有关信息。</p>", "object-key-init"),
    "CLUP.text.Baggage.Note_WCAG": cc11001100_hook("CLUP.text.Baggage.Note_WCAG", "<p>您的行李限额视乎旅程目的地及马可孛罗会级别而定。需支付额外行李费用。<a href=\"http://www.cathaypacific.com/cx/sc_CN/travel-information/baggage.html\" target=\"_blank\">在此处查看行李信息<img src=\"https://www.cathaypacific.com/content/dam/system-folder/cx/en_HK/images/global/open-a-new-window.png\" alt=\"在此处查看行李信息，网站在新窗口中打开\"></a>。可通过此步骤后的概要查阅行李限额的有关信息。</p>", "object-key-init"),
    "CLUP.text.Benefits.AmenityKit": cc11001100_hook("CLUP.text.Benefits.AmenityKit", "环保<strong>旅行护理套装</strong>", "object-key-init"),
    "CLUP.text.Benefits.Business.AltDesc1": cc11001100_hook("CLUP.text.Benefits.Business.AltDesc1", "我们选用英国时尚生活品牌Bamford的豪华400针寝具及床罩，让你放松恬睡。", "object-key-init"),
    "CLUP.text.Benefits.Business.AltDesc2": cc11001100_hook("CLUP.text.Benefits.Business.AltDesc2", "我们在环球主要机场均设有商务贵宾室，你可到深人欢迎的「风味坊」品嚐美食，往淋浴间焕发身心，在「瑜逸阁」放松舒展，或於舒适兼私隐度高的环境下处理工作。", "object-key-init"),
    "CLUP.text.Benefits.Business.AltDesc3": cc11001100_hook("CLUP.text.Benefits.Business.AltDesc3", "我们为商务客舱旅客搜罗本地新鲜食材及精选美酒，提供多款菜式，当中包括轻盈与健康餐点，以及香港正宗风味美食。", "object-key-init"),
    "CLUP.text.Benefits.Business.AltDesc4": cc11001100_hook("CLUP.text.Benefits.Business.AltDesc4", "丰富的机上娱乐节目包括现场体育赛事、高清电影及大量亚洲区内精彩作品，再配合更大屏幕及隔音耳筒，为你带来充实愉快的旅程。", "object-key-init"),
    "CLUP.text.Benefits.Business.AltDesc5": cc11001100_hook("CLUP.text.Benefits.Business.AltDesc5", "商务客舱提供私人工作空间，并设有可伸延桌面、电源插座及可调照明，给你一个可以专注无虑的工作环境。", "object-key-init"),
    "CLUP.text.Benefits.Business.AltDesc6": cc11001100_hook("CLUP.text.Benefits.Business.AltDesc6", "尊享更多行李限额及优先登机，令旅程更高效顺畅。", "object-key-init"),
    "CLUP.text.Benefits.Business.AltText1": cc11001100_hook("CLUP.text.Benefits.Business.AltText1", "於长途航班上享受全平卧睡床的舒适", "object-key-init"),
