    "CLUP.text.Benefits.First.AltDesc1": cc11001100_hook("CLUP.text.Benefits.First.AltDesc1", "当你準备悠然入睡，我们会悉心打点一切，为你预备好高空中舒适的睡床。寝具选用600针纯棉，质感柔软；精选Bamford的纯净有机护肤品给你肌肤最天然呵护。", "object-key-init"),
    "CLUP.text.Benefits.First.AltDesc2": cc11001100_hook("CLUP.text.Benefits.First.AltDesc2", "你可点选各式美食及使用按摩服务，并置身「恬逸间」享受悠然一刻。我们还可在你淋浴时提供熨衣服务，尽显细心周到。", "object-key-init"),
    "CLUP.text.Benefits.First.AltDesc3": cc11001100_hook("CLUP.text.Benefits.First.AltDesc3", "我们的餐单经全新设计，严选时令食材，并给你自由选择用餐时间。另外更备有顶级香槟、陈年佳酿及高质餐酒。", "object-key-init"),
    "CLUP.text.Benefits.First.AltDesc4": cc11001100_hook("CLUP.text.Benefits.First.AltDesc4", "最新猛片、整季剧集、现场体育赛事及大量亚洲区内精彩作品，再配合18.5吋屏幕及Bose隔音耳筒，给你带来极致视听娱乐享受。", "object-key-init"),
    "CLUP.text.Benefits.First.AltDesc5": cc11001100_hook("CLUP.text.Benefits.First.AltDesc5", "我们亲切细心的空中服务员会为你提供周到的服务，力求给你舒适愉悦的空中旅程。", "object-key-init"),
    "CLUP.text.Benefits.First.AltDesc6": cc11001100_hook("CLUP.text.Benefits.First.AltDesc6", "自成一角的登机手续柜檯及专属快證服务助你轻松完成登机程序。", "object-key-init"),
