    "CONF.text.regUser.beOurMember": cc11001100_hook("CONF.text.regUser.beOurMember", "成为我们的会员", "object-key-init"),
    "CONF.text.remark.car": cc11001100_hook("CONF.text.remark.car", "在本次旅程中，国泰航空将为您提供一程由<strong>大湾区内地城市*</strong>往香港国际机场的点对点免费跨境专车服务。 为确保您有一段舒适及愉快的旅程，请<span><a href=\"https://www.cathaypacific.com/ltms-web/#/sc_CN/login\" target=\"_blank\">按此<img src=\"https://www.cathaypacific.com/content/dam/system-folder/cx/en_HK/images/global/open-a-new-window.png\" alt=\", opens in a new window\"></a></span>预约专车。（备注：请于兑换前完成您的机票预订）\n<P>大湾区内地城市*：请参考预约兑换页面中的城市列表</P>", "object-key-init"),
    "CONF.text.remark.carpool": cc11001100_hook("CONF.text.remark.carpool", "在本次旅程中，国泰航空将为您提供一程由<strong>大湾区内地城市*</strong>往香港国际机场的免费跨境班车服务。\n为确保您有一段舒适及愉快的旅程，请立即<span><a href=\"https://www.cathaypacific.com/ltms-web/#/sc_CN/login\" target=\"_blank\">在此<img src=\"https://www.cathaypacific.com/content/dam/system-folder/cx/en_HK/images/global/open-a-new-window.png\" alt=\", opens in a new window\"></a></span> 兑换车票。（备注：请于兑换前完成您的机票预订）\n<P>大湾区内地城市*：请参考预约兑换页面中的城市列表</P>", "object-key-init"),
    "CONF.text.reminder.2CTrain": cc11001100_hook("CONF.text.reminder.2CTrain", "您的行程包括 TGV Air 火车及航班接驳服务。每次乘搭火车前，请前往 SNCF 火车站的 TGV Air 柜台。出示预订确认及有效的身份证明后，即可领取火车票。", "object-key-init"),
    "CONF.text.reminder.arrFerry.3A": cc11001100_hook("CONF.text.reminder.arrFerry.3A", "*乘搭<strong>航班转乘快船</strong>的乘客注意事项：抵达香港国际机场后，请在快船出发时间前最少 60 分钟前往 E2 转机区珠江客运 (CKS) 柜台换领往中国内地的船票。", "object-key-init"),
    "CONF.text.reminder.arrFerry.8C": cc11001100_hook("CONF.text.reminder.arrFerry.8C", "*搭乘航班转乘快船的乘客之注意事项：抵达香港国际机场后，请在快船出发时间前最少 60 分钟前往 E2 转机区<a class=\"ribe-link-in-para\" href=\"http://www.cotaiwaterjet.com/index.html\" target=\"_blank\">金光飞航</a>柜台换领前往澳门的船票。", "object-key-init"),
    "CONF.text.reminder.arrFerry.8S": cc11001100_hook("CONF.text.reminder.arrFerry.8S", "*搭乘航班转乘快船的乘客之注意事项：抵达香港国际机场后，请在快船出发时间前最少 60 分钟前往 E2 转机区<a class=\"ribe-link-in-para\" href=\"http://www.turbojet.com.hk/en/\" target=\"_blank\"> 信德中旅–喷射飞航</a> 柜台柜台换领前往澳门的船票。", "object-key-init"),
    "CONF.text.reminder.chinaFerry.3A.FYG": cc11001100_hook("CONF.text.reminder.chinaFerry.3A.FYG", "<div><strong>从深圳出发</strong>：请在快船出发时间前最少60分钟于<a class=\"ribe-link-in-para\" href=\"https://www.szairport.com/szairport/kechuan/zlm_tt.shtml\" target=\"_blank\">深圳机场码头<img src=\"https://www.cathaypacific.com/content/dam/system-folder/cx/en_HK/images/global/open-a-new-window.png\" alt=\" opens in a new window\" /></a>的香港机场值机柜台领取船票。</div>", "object-key-init"),
    "CONF.text.reminder.chinaFerry.3A.NSZ": cc11001100_hook("CONF.text.reminder.chinaFerry.3A.NSZ", "<div><strong>从广州出发</strong>：请在快船出发时间前最少60分钟于 <a class=\"ribe-link-in-para\" href=\"https://www.nskyg.com/\" target=\"_blank\">南沙港<img src=\"https://www.cathaypacific.com/content/dam/system-folder/cx/en_HK/images/global/open-a-new-window.png\" alt=\" opens in a new window\" /></a>的香港机场值机柜台领取船票。</div>", "object-key-init"),
    "CONF.text.reminder.chinaFerry.3A.ZGN": cc11001100_hook("CONF.text.reminder.chinaFerry.3A.ZGN", "<ul><li><strong>从中山出发</strong>：请在快船出发时间前最少60分钟于<a class=\"ribe-link-in-para\" href=\"http://www.zspassenger.com.cn\" target=\"_blank\">中山港<img src=\"https://www.cathaypacific.com/content/dam/system-folder/cx/en_HK/images/global/open-a-new-window.png\" alt=\" opens in a new window\" /></a>的香港机场值机柜台领取船票。</li></ul>", "object-key-init"),
    "CONF.text.reminder.chinaFerry.3A.ZIY": cc11001100_hook("CONF.text.reminder.chinaFerry.3A.ZIY", "<div><strong>从广州出发</strong>：请在快船出发时间前最少60分钟于<a class=\"ribe-link-in-para\" href=\"https://lhspc.qualitrip.cn/zh-CN/ticket\" target=\"_blank\">莲花山港<img src=\"https://www.cathaypacific.com/content/dam/system-folder/cx/en_HK/images/global/open-a-new-window.png\" alt=\" opens in a new window\" /></a>的香港机场值机柜台领取船票。</div>", "object-key-init"),
    "CONF.text.reminder.chinaFerry.3A.ZTI": cc11001100_hook("CONF.text.reminder.chinaFerry.3A.ZTI", "<div><strong>从东莞出发</strong>：请在快船出发时间前最少60分钟于<a class=\"ribe-link-in-para\" href=\"http://www.seasyoung.com\" target=\"_blank\">虎门港澳客运码头<img src=\"https://www.cathaypacific.com/content/dam/system-folder/cx/en_HK/images/global/open-a-new-window.png\" alt=\" opens in a new window\" /></a>的香港机场值机柜台领取船票。</div>", "object-key-init"),
    "CONF.text.reminder.chinaFerry.3A.ZUI": cc11001100_hook("CONF.text.reminder.chinaFerry.3A.ZUI", "<div><strong>从珠海出发</strong>：请在快船出发时间前最少60分钟前往<a class=\"ribe-link-in-para\" href=\"http://www.zhjzg.com\" target=\"_blank\">九洲港<img src=\"https://www.cathaypacific.com/content/dam/system-folder/cx/en_HK/images/global/open-a-new-window.png\" alt=\" opens in a new window\" /></a>的“境外航线售票处”领取船票，再到香港机场值机柜台办理登机手续。</div>", "object-key-init"),
    "CONF.text.reminder.chinaFerry.3A.ZYK": cc11001100_hook("CONF.text.reminder.chinaFerry.3A.ZYK", "<div><strong>在深圳</strong>：请在快船出发时间前最少 120 分钟于<a class=\"ribe-link-in-para\" href=\"https://www.cmskchp.com\" target=\"_blank\"> 深圳蛇口邮轮母港<img src=\"https://www.cathaypacific.com/content/dam/system-folder/cx/en_HK/images/global/open-a-new-window.png\" alt=\" opens in a new window\" /></a> 的国泰航空登机柜台领取船票。登机柜台于快船出发前 60 分钟关闭。</div>", "object-key-init"),
    "CONF.text.reminder.chinaFerry.Header": cc11001100_hook("CONF.text.reminder.chinaFerry.Header", "乘搭<strong>快船接駁</strong>的乘客注意事項:", "object-key-init"),
    "CONF.text.reminder.chinaFerry.HKG": cc11001100_hook("CONF.text.reminder.chinaFerry.HKG", "<ul><li><strong>抵達香港機場</strong>：請在快船出發前最少60分鐘前往E2轉機區的往內地/澳門快船票務櫃檯珠江客運 (CKS)換領前往珠三角的船票。</li></ul>", "object-key-init"),
    "CONF.text.reminder.depFerry.3A.FYG": cc11001100_hook("CONF.text.reminder.depFerry.3A.FYG", "*乘搭<strong>快船转乘航</strong>班的乘客注意事项：请在快船出发时间前最少 60 分钟于中国内地客运码头的<a class=\"ribe-link-in-para\" href=\"http://jcmt.szairport.com\" target=\"_blank\">珠江客运 (CKS)</a> 柜台或国泰航空办理登机手续柜台领取船票。", "object-key-init"),
    "CONF.text.reminder.depFerry.3A.NSZ": cc11001100_hook("CONF.text.reminder.depFerry.3A.NSZ", "*乘搭<strong>快船转乘航</strong>班的乘客注意事项：请在快船出发时间前最少 60 分钟于中国内地客运码头的<a class=\"ribe-link-in-para\" href=\"http://www.lhsgp.com\" target=\"_blank\">珠江客运 (CKS) </a>柜台或国泰航空办理登机手续柜台领取船票。", "object-key-init"),
