    "EMAI.text.PaxDet.FootNoteBag": cc11001100_hook("EMAI.text.PaxDet.FootNoteBag", "行李重量及客舱限制适用，请参阅<a href=\"https://www.cathaypacific.com/cx/sc_CN/baggage/check-in-baggage/cathay-pacific-flights.html\" target=\"_blank\">托运行李 <img src=\"https://www.cathaypacific.com/content/dam/system-folder/cx/en_HK/images/global/open-a-new-window.png\" alt=\"，在新窗口中打开\"></a>及<a href=\"https://www.cathaypacific.com/cx/sc_CN/baggage/cabin-baggage.html\" target=\"_blank\">手提行李 <img src=\"https://www.cathaypacific.com/content/dam/system-folder/cx/en_HK/images/global/open-a-new-window.png\" alt=\"，在新窗口中打开\"></a> 页面以了解最新信息。", "object-key-init"),
    "EMAI.text.PaxDet.FootNoteMPO": cc11001100_hook("EMAI.text.PaxDet.FootNoteMPO", "马可孛罗会会员应浏览<a href=\" https://www.cathaypacific.com/cx/sc_CN/baggage/check-in-baggage/cathay-pacific-flights.html\" target=\"_blank\">托运行李 <img src=\"https://www.cathaypacific.com/content/dam/system-folder/cx/en_HK/images/global/open-a-new-window.png\" alt=\", opens in a new window\"></a>和<a href=\" https://www.cathaypacific.com/cx/sc_CN/baggage/cabin-baggage.html\" target=\"_blank\">手提行李 <img src=\"https://www.cathaypacific.com/content/dam/system-folder/cx/en_HK/images/global/open-a-new-window.png\" alt=\", opens in a new window\"></a>页面了解额外行李资格。更多了解通过我们的推广活动获得的额外行李限额，请参阅电子机票。", "object-key-init"),
