    "EMAI.text.philippineDestination": cc11001100_hook("EMAI.text.philippineDestination", "菲律宾公民、须缴纳税项的外国护照持有人及非移民外国护照持有人如在菲律宾逗留超过一年，须在出发前到位于菲律宾机场的旅游基础设施和企业区管理局 (TIEZA) 柜台缴纳菲律宾旅游税。有关菲律宾旅游税的更多信息，请访问 <a href=\"http://tieza.gov.ph/travel-tax/\" target=\"_blank\" style=\"color:#0F748F; text-decoration: none;\">http://tieza.gov.ph/travel-tax/<img src=\"https://www.cathaypacific.com/content/dam/system-folder/cx/en_HK/images/global/open-a-new-window.png\" alt=\"菲律宾旅游局，网站在新窗口中打开\"></a>。\n<br><br>从克拉克或宿雾出发的国际航班乘客须在机场以现金支付客运大楼费。详情请参阅 <a href=\"http://crk.clarkairport.com/passenger-guide\" target=\"_blank\" style=\"color:#0F748F; text-decoration: none;\">http://crk.clarkairport.com/passenger-guide<img src=\"https://www.cathaypacific.com/content/dam/system-folder/cx/en_HK/images/global/open-a-new-window.png\" alt=\"克拉克国际机场，网站在新窗口中打开\"></a> 或 <a href=\"http://www.mactan-cebuairport.com.ph/passenger-guide\" target=\"_blank\" style=\"color:#0F748F; text-decoration: none;\">http://www.mactan-cebuairport.com.ph/passenger-guide<img src=\"https://www.cathaypacific.com/content/dam/system-folder/cx/en_HK/images/global/open-a-new-window.png\" alt=\"麦克坦 - 宿雾国际机场，网站在新窗口中打开\"></a>。", "object-key-init"),
    "EMAI.text.preferredSeat": cc11001100_hook("EMAI.text.preferredSeat", "首选座位", "object-key-init"),
    "EMAI.text.prepaidSeat": cc11001100_hook("EMAI.text.prepaidSeat", "已预选座位", "object-key-init"),
    "EMAI.text.reminder.YouthNotice": cc11001100_hook("EMAI.text.reminder.YouthNotice", "请注意，您必须提供您的身份证件作为年龄证明方可享受此票价。证件需要在机场办理登机手续时出示，否则需要以全额重新购买机票。", "object-key-init"),
    "EMAI.text.RemindMsg.arrFerry.3A": cc11001100_hook("EMAI.text.RemindMsg.arrFerry.3A", "*乘搭<strong>航班转乘快船</strong>的乘客注意事项：抵达香港国际机场后，请在快船出发时间前最少 60 分钟前往 E2 转机区珠江客运 (CKS) 柜台换领往中国内地的船票。", "object-key-init"),
    "EMAI.text.RemindMsg.arrFerry.8C": cc11001100_hook("EMAI.text.RemindMsg.arrFerry.8C", "*搭乘航班转乘快船的乘客之注意事项：抵达香港国际机场后，请在快船出发时间前最少 60 分钟前往 E2 转机区<a class=\"ribe-link-in-para\" href=\"http://www.cotaiwaterjet.com/index.html\" target=\"_blank\">金光飞航</a>柜台换领前往澳门的船票。", "object-key-init"),
    "EMAI.text.RemindMsg.arrFerry.8S": cc11001100_hook("EMAI.text.RemindMsg.arrFerry.8S", "*搭乘航班转乘快船的乘客之注意事项：抵达香港国际机场后，请在快船出发时间前最少 60 分钟前往 E2 转机区<a class=\"ribe-link-in-para\" href=\"http://www.turbojet.com.hk/en/\" target=\"_blank\">信德中旅–喷射飞航</a> 柜台柜台换领前往澳门的船票。", "object-key-init"),
    "EMAI.text.RemindMsg.chinaFerry.3A.FYG": cc11001100_hook("EMAI.text.RemindMsg.chinaFerry.3A.FYG", "<li><strong>从深圳出发</strong>：请在快船出发时间前最少60分钟于<a class=\"ribe-link-in-para\" href=\"https://www.szairport.com/szairport/kechuan/zlm_tt.shtml\" target=\"_blank\">深圳机场码头<img src=\"https://www.cathaypacific.com/content/dam/system-folder/cx/en_HK/images/global/open-a-new-window.png\" alt=\" opens in a new window\" /></a>的香港机场值机柜台领取船票。</li>", "object-key-init"),
    "EMAI.text.RemindMsg.chinaFerry.3A.NSZ": cc11001100_hook("EMAI.text.RemindMsg.chinaFerry.3A.NSZ", "<li><strong>从广州出发</strong>：请在快船出发时间前最少60分钟于 <a class=\"ribe-link-in-para\" href=\"https://www.nskyg.com/\" target=\"_blank\">南沙港<img src=\"https://www.cathaypacific.com/content/dam/system-folder/cx/en_HK/images/global/open-a-new-window.png\" alt=\" opens in a new window\" /></a>的香港机场值机柜台领取船票。</li>", "object-key-init"),
    "EMAI.text.RemindMsg.chinaFerry.3A.ZGN": cc11001100_hook("EMAI.text.RemindMsg.chinaFerry.3A.ZGN", "<li><strong>从中山出发</strong>：请在快船出发时间前最少60分钟于<a class=\"ribe-link-in-para\" href=\"http://www.zspassenger.com.cn\" target=\"_blank\">中山港<img src=\"https://www.cathaypacific.com/content/dam/system-folder/cx/en_HK/images/global/open-a-new-window.png\" alt=\" opens in a new window\" /></a>的香港机场值机柜台领取船票。</li>", "object-key-init"),
    "EMAI.text.RemindMsg.chinaFerry.3A.ZIY": cc11001100_hook("EMAI.text.RemindMsg.chinaFerry.3A.ZIY", "<li><strong>从广州出发</strong>：请在快船出发时间前最少60分钟于<a class=\"ribe-link-in-para\" href=\"https://lhspc.qualitrip.cn/zh-CN/ticket\" target=\"_blank\">莲花山港<img src=\"https://www.cathaypacific.com/content/dam/system-folder/cx/en_HK/images/global/open-a-new-window.png\" alt=\" opens in a new window\" /></a>的香港机场值机柜台领取船票。</li>", "object-key-init"),
    "EMAI.text.RemindMsg.chinaFerry.3A.ZTI": cc11001100_hook("EMAI.text.RemindMsg.chinaFerry.3A.ZTI", "<li><strong>从东莞出发</strong>：请在快船出发时间前最少60分钟于<a class=\"ribe-link-in-para\" href=\"http://www.seasyoung.com\" target=\"_blank\">虎门港澳客运码头<img src=\"https://www.cathaypacific.com/content/dam/system-folder/cx/en_HK/images/global/open-a-new-window.png\" alt=\" opens in a new window\" /></a>的香港机场值机柜台领取船票。</li>", "object-key-init"),
    "EMAI.text.RemindMsg.chinaFerry.3A.ZUI": cc11001100_hook("EMAI.text.RemindMsg.chinaFerry.3A.ZUI", "<li><strong>从珠海出发</strong>：请在快船出发时间前最少60分钟前往<a class=\"ribe-link-in-para\" href=\"http://www.zhjzg.com\" target=\"_blank\">九洲港<img src=\"https://www.cathaypacific.com/content/dam/system-folder/cx/en_HK/images/global/open-a-new-window.png\" alt=\" opens in a new window\" /></a>的“境外航线售票处”领取船票，再到香港机场值机柜台办理登机手续。</li>", "object-key-init"),
    "EMAI.text.RemindMsg.chinaFerry.3A.ZYK": cc11001100_hook("EMAI.text.RemindMsg.chinaFerry.3A.ZYK", "<ul><li><strong>在深圳</strong>：请在快船出发时间前最少 120 分钟于<a class=\"ribe-link-in-para\" href=\"https://www.cmskchp.com\" target=\"_blank\"> 深圳蛇口邮轮母港<img src=\"https://www.cathaypacific.com/content/dam/system-folder/cx/en_HK/images/global/open-a-new-window.png\" alt=\" opens in a new window\" /></a> 的国泰航空登机柜台领取船票。登机柜台于快船出发前 60 分钟关闭。</li></ul>", "object-key-init"),
    "EMAI.text.RemindMsg.chinaFerry.HKG": cc11001100_hook("EMAI.text.RemindMsg.chinaFerry.HKG", "<li><strong>抵達香港機場</strong>：請在快船出發前最少60分鐘前往E2轉機區的往內地/澳門快船票務櫃檯珠江客運 (CKS)換領前往珠三角的船票。</li>", "object-key-init"),
    "EMAI.text.RemindMsg.depFerry.3A.FYG": cc11001100_hook("EMAI.text.RemindMsg.depFerry.3A.FYG", "*乘搭<strong>快船转乘航</strong>班的乘客注意事项：请在快船出发时间前最少 60 分钟于中国内地客运码头的<a class=\"ribe-link-in-para\" href=\"http://jcmt.szairport.com\" target=\"_blank\">珠江客运 (CKS)</a> 柜台或国泰航空办理登机手续柜台领取船票。", "object-key-init"),
