    "OWUP.text.FareConditions.AsiaMilesContent": cc11001100_hook("OWUP.text.FareConditions.AsiaMilesContent", "马可孛罗会及「亚洲万里通」会员乘搭国泰航空或伙伴航空公司的航班时，即可累积里数。<a href= \"https://www.asiamiles.com/sc/home.html\" target= \"_blank\">在此了解有关累积「亚洲万里通」里数的信息<img src=\"https://www.cathaypacific.com/content/dam/system-folder/cx/en_HK/images/global/open-a-new-window.png\" alt=\", opens in a new window\"></a>。", "object-key-init"),
