    "OWUP.text.FareConditions.BaggageContent": cc11001100_hook("OWUP.text.FareConditions.BaggageContent", "托运行李限额按照目的地及所乘客舱级别而有所不同。有关详情，请浏览我们的<a href=\"https://www.cathaypacific.com/cx/sc_CN/baggage/check-in-baggage/cathay-pacific-flights.html\" target=\"_blank\">行李须知<img src=\"https://www.cathaypacific.com/content/dam/system-folder/cx/en_HK/images/global/open-a-new-window.png\" alt=\"行李须知\"></a> 页面。", "object-key-init"),
