    "OWUP.text.FareConditions.BaggageSubHeading1": cc11001100_hook("OWUP.text.FareConditions.BaggageSubHeading1", "手提行李", "object-key-init"),
    "OWUP.text.FareConditions.BaggageSubHeading2": cc11001100_hook("OWUP.text.FareConditions.BaggageSubHeading2", "手提行李限额按照目的地及所乘客舱级别而有所不同。有关详情，请浏览我们的<a href=\" https://www.cathaypacific.com/cx/sc_CN/baggage/cabin-baggage.html\" target=\"_blank\">行李须知<img src=\"https://www.cathaypacific.com/content/dam/system-folder/cx/en_HK/images/global/open-a-new-window.png\" alt=\"行李须知\"></a>页面。", "object-key-init"),
    "OWUP.text.FareConditions.cabinBaggageSubHeading1": cc11001100_hook("OWUP.text.FareConditions.cabinBaggageSubHeading1", "手提行李限额按照目的地及所乘客舱级别而有所不同。有关详情，请浏览我们的<a href=\" https://www.cathaypacific.com/cx/sc_CN/baggage/cabin-baggage.html\" target=\"_blank\">行李须知<img src=\"https://www.cathaypacific.com/content/dam/system-folder/cx/en_HK/images/global/open-a-new-window.png\" alt=\"行李须知\"></a>页面。", "object-key-init"),
    "OWUP.text.FareConditions.cabinBaggageSubHeading2": cc11001100_hook("OWUP.text.FareConditions.cabinBaggageSubHeading2", "", "object-key-init"),
    "OWUP.text.FareConditions.CancellationAfterDeparture": cc11001100_hook("OWUP.text.FareConditions.CancellationAfterDeparture", "取消手续费", "object-key-init"),
    "OWUP.text.FareConditions.CancellationAfterDepartureContent": cc11001100_hook("OWUP.text.FareConditions.CancellationAfterDepartureContent", "你可通过支付取消手续费来取消全部未使用的机票，并取回相关退款。你也可通过支付取消手续费来取消已部分使用的机票，并取回减去已使用部分的机票费用之相关退款。\n<br><br>\n国泰会员可通过 \n<a href=\"https://www.cathaypacific.com/cx/sc_CN/manage-booking/manage-booking.html\" target=\"_blank\">\n自助订位管理服务\n<img src=\"https://www.cathaypacific.com/content/dam/system-folder/cx/en_HK/images/global/open-a-new-window.png\" alt=\"自助订位管理服务, opens in a new window\"></a> \n于 24 小时内免费取消完全未使用的机票。客户需在预订时于乘客信息页面填写其国泰会员编号。机票必须在出发前至少八天购买，方可享受此礼遇。旅行附加费包括但不限于旅行保险和保留预订等不符合 24 小时免费取消条件，因此不可退款。请访问\n<a href=\"https://www.cathaypacific.com/cx/sc_CN/faqs/booking-and-manage/rebook-cancel-your-flight-and-refund/cancel-your-flight-and-refund.html\" target=\"_blank\">\n链接\n<img src=\"https://www.cathaypacific.com/content/dam/system-folder/cx/en_HK/images/global/open-a-new-window.png\" alt=\"链接, opens in a new window\"></a>了解更多详情。", "object-key-init"),
    "OWUP.text.FareConditions.CancellationAfterDepartureHeader": cc11001100_hook("OWUP.text.FareConditions.CancellationAfterDepartureHeader", "", "object-key-init"),
    "OWUP.text.FareConditions.checkInBaggageSubHeading1": cc11001100_hook("OWUP.text.FareConditions.checkInBaggageSubHeading1", "托运行李限额按照目的地及所乘客舱级别而有所不同。有关详情，请浏览我们的<a href=\"https://www.cathaypacific.com/cx/sc_CN/baggage/check-in-baggage/cathay-pacific-flights.html\" target=\"_blank\">行李须知<img src=\"https://www.cathaypacific.com/content/dam/system-folder/cx/en_HK/images/global/open-a-new-window.png\" alt=\"行李须知\"></a> 页面。", "object-key-init"),
