    "OWUP.text.FareConditions.ClubPointsContent": cc11001100_hook("OWUP.text.FareConditions.ClubPointsContent", "马可孛罗会会员乘搭国泰航空或寰宇一家联盟旗下任何航空公司的航班时，即可累积会籍积分。<a href = \"https://www.cathaypacific.com/cx/sc_CN/frequent-flyers/about-the-club/club-benefits.html\" target=\"_blank\">在此了解马可孛罗会礼遇</a>。", "object-key-init"),
