    "OWUP.text.FareConditions.NoShowContent": cc11001100_hook("OWUP.text.FareConditions.NoShowContent", "若你已网上预办登机，但最终没有乘搭航班，将被收取未能依时登机费用。若你错过了机票前一航段的航班，也可能会被收取未能依时登机费用；同一预订中任何后续航班的机位都会自动取消，并视为不可退款。就接驳航班而言，你必须按次序乘搭机票上的航班。", "object-key-init"),
