    "OWUP.text.FareConditions.PreBookSeatContent": cc11001100_hook("OWUP.text.FareConditions.PreBookSeatContent", "头等、公务、特选经济及指定经济舱乘客可免费选择心仪座位。购买其他经济舱机票的乘客可支付象征式费用预选座位。请浏览<a href=\"https://www.cathaypacific.com/cx/sc_CN/manage-booking/travel-extras/reserve-your-seat/regular-seat.html\" target=\"_blank\">座位选择 <img src=\"https://www.cathaypacific.com/content/dam/system-folder/cx/en_HK/images/global/open-a-new-window.png\" alt=\", opens in a new window\"></a>以了解详情。\n<br>\n<br>\n注意：座位选择服务只适用于国泰航空航班。", "object-key-init"),
