    "OWUP.text.FareConditions.ReBookingContent": cc11001100_hook("OWUP.text.FareConditions.ReBookingContent", "你可更改出发日期及／或时间，前提是新机票的航线相同，且预订级别相同。注意：你不可更改航线（即出发及抵达城市必须相同。） 有关详情，请浏览我们的<a href= \"https://www.cathaypacific.com/cx/sc_CN/contact-us.html\" target= \"_blank\">常见问题 <img src=\"https://www.cathaypacific.com/content/dam/system-folder/cx/en_HK/images/global/open-a-new-window.png\" alt=\", opens in a new window\"></a>页面。", "object-key-init"),
