    "PINS.text.koreanConsent.box2.Agree_Access": cc11001100_hook("PINS.text.koreanConsent.box2.Agree_Access", "本人同意并确认，本人已经阅读并了解上述有关将个人信息转移给第三方和外国的条件。（在您同意之前不会处理预订和付款。）", "object-key-init"),
