    "PINS.text.koreanConsent.box2.CollapsibleLinkFour": cc11001100_hook("PINS.text.koreanConsent.box2.CollapsibleLinkFour", "收件人处理和保留个人信息的时间", "object-key-init"),
    "PINS.text.koreanConsent.box2.CollapsibleLinkFourDesc": cc11001100_hook("PINS.text.koreanConsent.box2.CollapsibleLinkFourDesc", "<ol type = \"a\"><li>亚洲万里通有限公司/Amadeus IT group<br>因个人信息已达到收集和处理目的之后不再有用，且将不再用于此类用途，为了满足解决争端等少数用途的需求，个人信息将最多再存储 7 年。如果因其他法律要求需要保留个人信息，存储时间将按照要求继续延长。</li><li><b>「寰宇一家」</b>联盟<br>将根据接受者的个人信息保护政策保留个人信息。</li></ol>", "object-key-init"),
