    "PINS.text.koreanConsent.box2.CollapsibleLinkTwo": cc11001100_hook("PINS.text.koreanConsent.box2.CollapsibleLinkTwo", "提供的个人信息项目", "object-key-init"),
    "PINS.text.koreanConsent.box2.CollapsibleLinkTwoDesc": cc11001100_hook("PINS.text.koreanConsent.box2.CollapsibleLinkTwoDesc", "<ol type=\"a\"><li>亚洲万里通有限公司/Amadeus IT group<br>「亚洲万里通」或马可孛罗会会员编号、用户及同行旅伴的姓氏/名字/称谓、联系方式（电子邮件）、邮寄地址（家庭/办公）、餐食偏好/座位偏好、目的地联络人信息（姓名、电话号码）、目的地地址（街道、城市、州、邮政编码、国家）、国籍、性别、旅行证件（编号、到期日和签发国家）、其他旅行证件（类型、编号、到期日、签发国家、旅客护照识别号码）、居住地区（城市、州、国家、邮政编码）、紧急联络人（姓名、电话号码）、信用卡类型、信用卡号、到期日、CVC 信用卡认证编号、持卡人姓名、账单邮寄地址、国家、服务记录数据、访问记录、数码存根、付款记录。<li><b>「寰宇一家」</b>联盟<br><b>「寰宇一家」</b>飞行常客编号</ol>", "object-key-init"),
    "PINS.text.koreanConsent.box2.CollapsibleLinkTwoDesc.Neo": cc11001100_hook("PINS.text.koreanConsent.box2.CollapsibleLinkTwoDesc.Neo", "<ol type=\"a\"><li>亚洲万里通有限公司/Amadeus IT group<br>「亚洲万里通」或马可孛罗会会员编号、用户及同行旅伴的姓氏/名字/称谓、联系方式（电子邮件）、邮寄地址（家庭/办公）、餐食偏好/座位偏好、目的地联络人信息（姓名、电话号码）、目的地地址（街道、城市、州、邮政编码、国家）、国籍、性别、旅行证件（编号、到期日和签发国家）、其他旅行证件（类型、编号、到期日、签发国家、旅客护照识别号码）、居住地区（城市、州、国家、邮政编码）、紧急联络人（姓名、电话号码）、信用卡类型、信用卡号、到期日、CVC 信用卡认证编号、持卡人姓名、账单邮寄地址、国家、服务记录数据、访问记录、数码存根、付款记录。<li><b>「寰宇一家」</b>联盟<br><b>「寰宇一家」</b>飞行常客编号</ol>", "object-key-init"),
    "PINS.text.koreanConsent.box2.Desc": cc11001100_hook("PINS.text.koreanConsent.box2.Desc", "国泰航空在未得到您的明确同意之前不会将您的个人信息传送给第三方，除非法律要求。但是，通过该系统将收集到的个人信息立即发送给位于香港的子公司或联营公司，以提供相关服务。", "object-key-init"),
    "PINS.text.koreanConsent.box2.Error": cc11001100_hook("PINS.text.koreanConsent.box2.Error", "请表明您接受同意，然后继续。", "object-key-init"),
    "PINS.text.koreanConsent.box2.Heading": cc11001100_hook("PINS.text.koreanConsent.box2.Heading", "同意将个人信息提供给第三方和外国的规定", "object-key-init"),
    "PINS.text.koreanConsent.box2.TnC": cc11001100_hook("PINS.text.koreanConsent.box2.TnC", "兹确认，我已经阅读并了解上述有关向第三方和海外传送个人信息的条件。（在您同意之前不会处理预订和付款。）", "object-key-init"),
    "PINS.text.koreanConsent.CollapsibleLinkFour": cc11001100_hook("PINS.text.koreanConsent.CollapsibleLinkFour", "拒绝同意收集和使用个人信息", "object-key-init"),
    "PINS.text.koreanConsent.CollapsibleLinkFourDesc": cc11001100_hook("PINS.text.koreanConsent.CollapsibleLinkFourDesc", "您可以拒绝同意收集和使用个人信息。但是，如果拒绝，我们将无法处理您的航班预订，也不能提供其他网上服务。", "object-key-init"),
    "PINS.text.koreanConsent.CollapsibleLinkOne": cc11001100_hook("PINS.text.koreanConsent.CollapsibleLinkOne", "为何需要收集和使用我的个人信息？", "object-key-init"),
    "PINS.text.koreanConsent.CollapsibleLinkOneDesc": cc11001100_hook("PINS.text.koreanConsent.CollapsibleLinkOneDesc", "出于航班预订、票务和办理登机手续的需要，我们会收集您的个人信息。除下列用途之外，我们不会将您提供的个人信息用于其他目的，除非您事先同意，或按照相关法律要求：<br><br><ul><span class=\"consent-title\">航班预订和票务</span></li><li>用于航班预订、票务和信用卡支付，以及通过电子邮件发送旅行证件（确认电子邮件或电子机票）等旅行相关的全部服务</li><li>提供行李相关的服务</li><li>用于飞行常客和里程计划</li><li>通过我们的网站和/或其他电信渠道使用在线服务等</li><li>使用我们的任何子公司、联营公司和/或商业伙伴提供的与客户关联的服务等</li></ul><ul><span class=\"consent-title\">办理登机手绩</span></li><li>用于识别和使用登机信息的任何客户等</li><li>用于网上预办登机手续和其他相关服务等</li></ul>", "object-key-init"),
    "PINS.text.koreanConsent.CollapsibleLinkThree": cc11001100_hook("PINS.text.koreanConsent.CollapsibleLinkThree", "使用和保留个人信息的期限", "object-key-init"),
    "PINS.text.koreanConsent.CollapsibleLinkThreeDesc": cc11001100_hook("PINS.text.koreanConsent.CollapsibleLinkThreeDesc", "因个人信息已达到收集和处理目的之后不再有用，且将不再用于此类用途，为了满足解决争端等少数用途的需求，个人信息将最多再存储 7 年。如果因其他法律要求需要保留个人信息，存储时间将按照要求继续延长。", "object-key-init"),
    "PINS.text.koreanConsent.CollapsibleLinkTwo": cc11001100_hook("PINS.text.koreanConsent.CollapsibleLinkTwo", "收集和使用个人信息的目的", "object-key-init"),
    "PINS.text.koreanConsent.CollapsibleLinkTwoDesc": cc11001100_hook("PINS.text.koreanConsent.CollapsibleLinkTwoDesc", "国泰航空不会将您提供的个人资料用于除以下范围之外的用途，您事先明确表示同意或适用法律要求的情况除外。<p><li>航班预订、票务、信用卡支付，提供以及通过电子邮件发送旅行证件（确认电子邮件或电子机票）等旅行相关的全部服务。<li>提供行李相关的服务等<li>用于飞行常客和里程计划等<li>通过国泰航空的网站和/或其他电信渠道使用在线服务等<li>使用国泰航空的任何子公司、联营公司和/或商业伙伴提供的与客户关联的服务。", "object-key-init"),
