    "PURC.text.asiamiles.earntable": cc11001100_hook("PURC.text.asiamiles.earntable", "<table><caption><h3 class=\"ribe-overlay-section-header\">翱翔蓝天，畅享礼遇</h3></caption><tbody class=\"row ribe-overlay-section-list\"><tr><th scope=\"row\" class=\"col-sm-6 col-md-4\"><strong>头等舱</strong></th>  <td class=\"col-sm-6 col-md-8\"><strong>150%</strong>实际飞行里数</td></tr><tr><th scope=\"row\" class=\"col-sm-6 col-md-4\"><strong>公务舱</strong></th><td class=\"col-sm-6 col-md-8\"><strong>125%</strong>实际飞行里数</td></tr><tr><th scope=\"row\" class=\"col-sm-6 col-md-4\"><strong>特选经济舱</strong></th><td class=\"col-sm-6 col-md-8\"><strong>110%</strong>实际飞行里数</td></tr><tr>  <th scope=\"row\" class=\"col-sm-6 col-md-4\"><strong>经济舱</strong></th><td class=\"col-sm-6 col-md-8\"><strong>100%、50% 或 25%</strong>实际飞行里数</td></tr></tbody></table>", "object-key-init"),
    "PURC.text.asiamiles.overview": cc11001100_hook("PURC.text.asiamiles.overview", "<h3 class=\"ribe-overlay-section-header ribe-overlay-section-header-first\">概览</h3>\n<p>「亚洲万里通」是亚洲引领时尚的旅游及休闲奖励计划，为您带来琳琅满目的精彩奖励，配合您独特的生活品味。您可搭乘国泰航空等 25 家「亚洲万里通」伙伴航空公司的航班，累积「亚洲万里通」里程用于兑换航班奖励、升级、旅伴机票和其他时尚生活品味奖励。轻松愉悦累积「亚洲万里通」里数。</p>\n<h3 class=\"ribe-overlay-section-header\">这对我有什么影响？</h3>\n<p>使用您的信用卡或手机，每天累积里数。从旅行、酒店、餐饮、交通到其他活动，均可以为您轻松累积里程。</p>\n<p>如果您还不是会员，<a href=\"https://www.asiamiles.com/am/sc/about/join\" target=\"_blank\">立即加入</a>享受更多「亚洲万里通」会籍礼遇。</p>\n<p>您可以累积的固定「亚洲万里通」里数是根据以下所显示计算方法以航程长度和票价类别所得。</p>", "object-key-init"),
    "PURC.text.asiamiles.overview.Neo": cc11001100_hook("PURC.text.asiamiles.overview.Neo", "<h3 class=\"ribe-overlay-section-header ribe-overlay-section-header-first\">概览</h3><p>「亚洲万里通」是亚洲引领时尚的旅游及休闲奖励计划，为您带来琳琅满目的精彩奖励，配合您独特的生活品味。您可搭乘国泰航空等 25 家「亚洲万里通」伙伴航空公司的航班，累积「亚洲万里通」里程用于兑换航班奖励、升级、旅伴机票和其他时尚生活品味奖励。轻松愉悦累积「亚洲万里通」里数。</p><h3 class=\"ribe-overlay-section-header\">这对我有什么影响？</h3><p>使用您的信用卡或手机，每天累积里数。从旅行、酒店、餐饮、交通到其他活动，均可以为您轻松累积里程。</p><p>如果您还不是会员，<a href=\"https://www.asiamiles.com/am/sc/about/join\" target=\"_blank\">立即加入<img src=\"https://www.cathaypacific.com/content/dam/system-folder/cx/en_HK/images/global/open-a-new-window.png\" alt=\"立即加入, opens in a new window\"></a>享受更多「亚洲万里通」会籍礼遇。</p>\n<p>您可以累积的固定「亚洲万里通」里数是根据以下所显示计算方法以航程长度和票价类别所得。</p>\n<p><a href= \"https://www.asiamiles.com/sc/home.html\" target= \"_blank\">了解更多有关累积「亚洲万里通」里数的详情<img src=\"https://www.cathaypacific.com/content/dam/system-folder/cx/en_HK/images/global/open-a-new-window.png\" alt=\"了解更多有关累积「亚洲万里通」里数的详情, opens in a new window\"></a></p>", "object-key-init"),
