    "PURC.text.CCWarning": cc11001100_hook("PURC.text.CCWarning", "请注意，您必须提供您的信用卡才可享受此票价。", "object-key-init"),
    "PURC.text.ChinaMarketBibitTnc": cc11001100_hook("PURC.text.ChinaMarketBibitTnc", "需使用有效的信用卡完成本次预订。我们目前接受下列支付卡：<br><br>中国境内签发的借记卡/信用卡<br><br>为了遵守中国有关互联网销售的银行业条例，中国境内签发的每一张借记卡/信用卡具有不同的每日累积限额，以及不同发卡机构设定的每笔交易限额。持卡人在开始购买之前应向发卡银行申请扩大限额。<br><br>在您点击\"购买\"键之后，您将重新导向至我们的付款服务供应商 - 银联。在选择本次交易用卡之后，在确认和最终完成您的预订之前，将在您的发卡银行的网站进行付款认证和授权。<br><br>请注意：<br><br>(1) 请在浏览器设置中允许弹出窗口，以完成本次交易。<br><br>(2) 在最终完成付款和预订请求过程中，请不要点击返回键、再次提交您的请求、刷新此页面或关闭浏览器；因为可能导致从您的卡账户中两次扣款，或者在授权付款后无法完成预订。<br><br>当您的发卡银行已授权付款交易，将无法取消，因为金额已从您的卡账户中直接扣除。如果适用，我们可能会安排退款（根据票价规定）；但是，将收取您所选票价的退款/取消费。至少需要 14 个工作日处理退款。<br><br>请注意，我们的付款服务供应商（银联）将出现在您的本次交易信用卡帐单中。", "object-key-init"),
    "PURC.text.ChinaMarketBtbTnc": cc11001100_hook("PURC.text.ChinaMarketBtbTnc", "需使用有效的信用卡完成本次预订。我们目前接受下列支付卡：<br><br>中国境内签发的借记卡/信用卡<br><br>为了遵守中国有关互联网销售的银行业条例，中国境内签发的每一张借记卡/信用卡具有不同的每日累积限额，以及不同发卡机构设定的每笔交易限额。持卡人在开始购买之前应向发卡银行申请扩大限额。<br><br>在您点击\"购买\"键之后，您将重新导向至我们的付款服务供应商 - 支付宝。在选择本次交易用卡之后，在确认和最终完成您的预订之前，将在您的发卡银行的网站进行付款认证和授权。<br><br>请注意：<br><br>(1) 请在浏览器设置中允许弹出窗口，以完成本次交易。<br><br>(2) 目前，我们的付款服务供应商（支付宝）和银行网站支持英语和简体中文。<br><br>在最终完成付款和预订请求过程中，请不要点击返回键、再次提交您的请求、刷新此页面或关闭浏览器；因为可能导致从您的卡账户中两次扣款，或者在授权付款后无法完成预订。<br><br>当您的发卡银行已授权付款交易，将无法取消，因为金额已从您的卡账户中直接扣除。如果适用，我们可能会安排退款（根据票价规定）；但是，将收取您所选票价的退款/取消费。至少需要 14 个工作日处理退款。<br><br>请注意，我们的付款服务供应商（支付宝）将出现在您的本次交易信用卡帐单中。", "object-key-init"),
