    "PURC.text.LRP.PaxDet.FootNoteMPO": cc11001100_hook("PURC.text.LRP.PaxDet.FootNoteMPO", "国泰会员应参阅<a href=\" https://www.cathaypacific.com/cx/sc_CN/baggage/check-in-baggage/cathay-pacific-flights.html\" target=\"_blank\">托运行李<img src=\"https://www.cathaypacific.com/content/dam/system-folder/cx/en_HK/images/global/open-a-new-window.png\" alt=\"托运行李，网站在新窗口中打开\"></a>及<a href=\" https://www.cathaypacific.com/cx/sc_CN/baggage/cabin-baggage.html\" target=\"_blank\">手提行李<img src=\"https://www.cathaypacific.com/content/dam/system-folder/cx/en_HK/images/global/open-a-new-window.png\" alt=\"手提行李，网站在新窗口中打开\"></a>页面以了解享有额外行李的资格。有关经我们推广活动获得的额外行李限额信息，请参阅电子机票。", "object-key-init"),
