    "PURC.text.marcopolo.overview": cc11001100_hook("PURC.text.marcopolo.overview", "<h3 class=\"ribe-overlay-section-header ribe-overlay-section-header-first\">概览</h3><p>马可孛罗会会员累积会籍积分，用于日后延续或晋升会籍级别。累积越多会籍积分，级别越高，从绿卡、银卡、金卡到钻石卡。当您累积的会籍积分达到一定值的时候，就可以享受马可孛罗会专属会籍级别间的额外礼遇。</p> <p><a href = \"http://www.cathaypacific.com/cx/sc_CN/frequent-flyers/about-the-club/club-benefits.html\" target=\"_blank\">更多了解马可孛罗会会籍礼遇></a> </p><p>您搭乘国泰航空和<b>「寰宇一家」</b>联盟任一航空公司符合资格的“子舱位”，即可累积会籍积分。会籍积分将按客舱级别、“子舱位”及飞行距离来计算。</p> <p><a href = \"http://www.cathaypacific.com/cx/sc_CN/frequent-flyers/about-the-club/earning-club-points.html\" target=\"_blank\">了解更多马可孛罗会会籍积分的详情></a> </p><h3 class=\"ribe-overlay-section-header\">这对我有什么影响？</h3><p><p>在您为期一年的会籍内累积的会籍积分将决定您来年的会籍级别。会籍积分在航班飞行后记入，注册前搭乘的航班无法累积会籍积分。</p><p> 如果您还不是会员，<a href= \"https://www.cathaypacific.com/cx/sc_CN/frequent-flyers/about-the-club/join-the-club-before-login.html\" target=\"_blank\">立即加入</a>，只需交纳 100 美元会籍申请费，即可享受马可孛罗会的众多礼遇。</p>", "object-key-init"),
    "PURC.text.marcopolo.overview.Neo": cc11001100_hook("PURC.text.marcopolo.overview.Neo", "<h3 class=\"ribe-overlay-section-header ribe-overlay-section-header-first\">概览</h3><p>马可孛罗会会员累积会籍积分，用于日后延续或晋升会籍级别。累积越多会籍积分，级别越高，从绿卡、银卡、金卡到钻石卡。当您累积的会籍积分达到一定值的时候，就可以享受马可孛罗会专属会籍级别间的额外礼遇。</p><p><a href = \"http://www.cathaypacific.com/cx/sc_CN/frequent-flyers/about-the-club/club-benefits.html\" target=\"_blank\">更多了解马可孛罗会会籍礼遇></a> </p><p>您搭乘国泰航空和<b>寰宇一家</b>联盟任一航空公司符合资格的“子舱位”，即可累积会籍积分。会籍积分将按客舱级别、“子舱位”及飞行距离来计算。</p> <p><a href = \"http://www.cathaypacific.com/cx/sc_CN/frequent-flyers/about-the-club/earning-club-points.html\" target=\"_blank\">了解更多马可孛罗会会籍积分的详情></a> </p><h3 class=\"ribe-overlay-section-header\">这对我有什么影响？</h3><p><p>在您为期一年的会籍内累积的会籍积分将决定您来年的会籍级别。会籍积分在航班飞行后记入，注册前搭乘的航班无法累积会籍积分。</p><p> 如果您还不是会员，<a href= \"https://www.cathaypacific.com/cx/sc_CN/frequent-flyers/about-the-club/join-the-club-before-login.html\" target=\"_blank\">立即加入</a>，只需交纳 100 美元会籍申请费，即可享受马可孛罗会的众多礼遇。</p>", "object-key-init"),
