    "PURC.text.overlay.FareDesc": cc11001100_hook("PURC.text.overlay.FareDesc", "什么是票价级别？", "object-key-init"),
    "PURC.text.Overlay.FareDescPara": cc11001100_hook("PURC.text.Overlay.FareDescPara", "<p>子舱位是购买机票时分配给您的一个字母。您收到的子舱位的类型由多重因素确定，包括您的购票时间、剩余的座位数和提供/已付的价格。</p><p>子舱位决定了您的行程将得到的「亚洲万里通」里数或马可孛罗会的会籍积分。</p><p>另外，它还决定了您是否可以用现有的「亚洲万里通」里数（或其他航空公司里数计划）进行升级。请注意，并非所有代号共享（非国泰航空）的航班都可以升级。<p>", "object-key-init"),
