    "PURC.text.payU.MasterExternalPaymentMessage": cc11001100_hook("PURC.text.payU.MasterExternalPaymentMessage", "<p>我们将为您跳转至PayU付款平台以处理此项交易。</p><p>请注意，在您能够处理付款之前，必须首先同意条款及细则。</p><p> 您必须在10分钟内完成付款。付款时请不要关闭浏览器，因为一旦您的交易被接纳，我们会将您重新导向至您的预订确认页面。", "object-key-init"),
    "PURC.text.philippineDestination": cc11001100_hook("PURC.text.philippineDestination", "菲律宾公民、须缴纳税项的外国护照持有人及非移民外国护照持有人如在菲律宾逗留超过一年，须在出发前到位于菲律宾机场的旅游基础设施和企业区管理局 (TIEZA) 柜台缴纳菲律宾旅游税。有关菲律宾旅游税的更多信息，请访问 <a href=\"http://tieza.gov.ph/travel-tax/\" target=\"_blank\" style=\"color:#0F748F; text-decoration: none;\">http://tieza.gov.ph/travel-tax/<img src=\"https://www.cathaypacific.com/content/dam/system-folder/cx/en_HK/images/global/open-a-new-window.png\" alt=\"菲律宾旅游局，网站在新窗口中打开\"></a>。\n<br><br>从克拉克或宿雾出发的国际航班乘客须在机场以现金支付客运大楼费。详情请参阅 <a href=\"http://crk.clarkairport.com/passenger-guide\" target=\"_blank\" style=\"color:#0F748F; text-decoration: none;\">http://crk.clarkairport.com/passenger-guide<img src=\"https://www.cathaypacific.com/content/dam/system-folder/cx/en_HK/images/global/open-a-new-window.png\" alt=\"克拉克国际机场，网站在新窗口中打开\"></a> 或 <a href=\"http://www.mactan-cebuairport.com.ph/passenger-guide\" target=\"_blank\" style=\"color:#0F748F; text-decoration: none;\">http://www.mactan-cebuairport.com.ph/passenger-guide<img src=\"https://www.cathaypacific.com/content/dam/system-folder/cx/en_HK/images/global/open-a-new-window.png\" alt=\"麦克坦 - 宿雾国际机场，网站在新窗口中打开\"></a>。", "object-key-init"),
