    "PURC.text.storedCard.disclaimerOverlayMsg": cc11001100_hook("PURC.text.storedCard.disclaimerOverlayMsg", "确保您的个人资料安全是我们的首要任务。因此，请注意以下事项：\n\n<ul> \n<li>您的信用卡信息将会加密并储存，作以后付款之用。</li>\n<li>如欲使用已储存的信用卡，您将要输入安全码 (CVV) 以供验证。</li>\n <li>您的银行卡信息将会加密并安全储存。您的信息在任何情况下都不会与任何第三方分享。</li>\n <li>付款成功完成后，您所更新的银行卡信息将被存储。</li>\n <li>您可以存储最多 5 张信用卡</li>\n <li>如果您选择购买保险，则存储卡的功能将被关闭</li>\n <li>需要 5-10 分钟时间于数据库更新卡片信息</li> </ul>", "object-key-init"),
