    "PURC.text.TermsAndCondition.BookingInformation.Body": cc11001100_hook("PURC.text.TermsAndCondition.BookingInformation.Body", "完成您的预订后，此票价即可确定不变。<br><br>\n此票价已包含机票的所有税费，但某些机场在办理登机时收取税费。如需了解特定于此票价的规定和限制，请查看票价规定。如需了解可能适用于退款或重新预订的费用，请查看票价规定，获取详情。<br><br>\n您的信用卡将按照所报票价的货币进行付款。信用卡发卡银行可能扣除您的国际交易费，取决于出发国家和信用卡货币。如需详情，请咨询您的发卡银行。<br><br>\n对于每一次成功预订，一封确认电子邮件和电子机票收据将发送至您注册的电子邮件地址。如果您未收到确认邮件，请联系我们寻求帮助。在旅行之前，建议您查看我们的机上健康信息。", "object-key-init"),
    "PURC.text.TermsAndCondition.BookingInformation.Heading": cc11001100_hook("PURC.text.TermsAndCondition.BookingInformation.Heading", "预订信息", "object-key-init"),
    "PURC.text.TermsAndCondition.ChinaMarketAXTnc.Body_HTML": cc11001100_hook("PURC.text.TermsAndCondition.ChinaMarketAXTnc.Body_HTML", "如果你要预订航班或航班相关服务，请参阅以下条款及细则。持卡人不需要为预订及乘搭航班的人士。如果使用 Visa 验证服务、万事达卡 SecureCode、美国运通 SafeKeyxAE、J/Secure™ 或 ProtectBuy 成功完成交易，持卡人将不必出示该卡以作核实。然而，国泰航空保留要求出示该信用卡以作核实的权利。<br><br> \n我明白如信用卡持有人或网上信用卡使用者未能于旅客办理登机手续或领取机票时出示订票时所用之信用卡，航空公司将有权拒绝让该旅客登机，或要求收取保证金（只收现金或以另一信用卡支付）。", "object-key-init"),
    "PURC.text.TermsAndCondition.Conditions.link": cc11001100_hook("PURC.text.TermsAndCondition.Conditions.link", "https://www.cathaypacific.com/content/dam/cx/legal-and-privacy/general-conditions-of-carriage-for-passengers-baggage-en.pdf", "object-key-init"),
    "PURC.text.TermsAndCondition.Conditions.text": cc11001100_hook("PURC.text.TermsAndCondition.Conditions.text", "载运条件及规例", "object-key-init"),
    "PURC.text.TermsAndCondition.EXLASRSeat": cc11001100_hook("PURC.text.TermsAndCondition.EXLASRSeat", "我同意于国泰航空网站上预订优先座位选择（预选座位）的<a class=\"ribe-link-in-para\" href=\"https://www.cathaypacific.com/cx/sc_CN/manage-booking/travel-extras/reserve-your-seat/regular-seat.html\" target=\"_blank\">“标准座位”<img src=\"https://www.cathaypacific.com/content/dam/system-folder/cx/en_HK/images/global/open-a-new-window.png\" alt=\"Regular Seat, opens in a new window\"></a> 或 <a class=\"ribe-link-in-para\" href=\"https://www.cathaypacific.com/cx/sc_CN/manage-booking/travel-extras/reserve-your-seat/extra-legroom-seat.html\" target=\"_blank\"> “加长空间座位”<img src=\"https://www.cathaypacific.com/content/dam/system-folder/cx/en_HK/images/global/open-a-new-window.png\" alt=\"Extra-legroom seat, opens in a new window\"></a>所附带的相关条款及细则。本人确认符合普通座位或加长空间座位的安全要求，并同意遵守条款和细则。（请查阅普通座位或加长空间座位<a class=\"ribe-link-in-para\" href=\"https://www.cathaypacific.com/cx/sc_CN/manage-booking/travel-extras/reserve-your-seat/extra-legroom-seat.html\" target=\"_blank\">的全部详情和安全要求 <img src=\"https://www.cathaypacific.com/content/dam/system-folder/cx/en_HK/images/global/open-a-new-window.png\" alt=\"Extra-legroom seat, opens in a new window\"></a>）。", "object-key-init"),
    "PURC.text.TermsAndCondition.EXLSeat": cc11001100_hook("PURC.text.TermsAndCondition.EXLSeat", "本人确认符合加长空间座位的安全要求，并同意遵守条款及细则。（请查阅<a class=\"ribe-link-in-para\" href=\"https://www.cathaypacific.com/cx/sc_CN/manage-booking/travel-extras/reserve-your-seat/extra-legroom-seat.html\" target=\"_blank\">加长空间座位的全部详情和安全要求<img src=\"https://www.cathaypacific.com/content/dam/system-folder/cx/en_HK/images/global/open-a-new-window.png\" alt=\"加长空间座位，网站在新窗口中打开\"></a>）。", "object-key-init"),
    "PURC.text.TermsAndCondition.FareRules": cc11001100_hook("PURC.text.TermsAndCondition.FareRules", "另外，我接受适用的<a href=''javascript:void(0)'' tabindex=\"0\" class=\"overlayLink fareRulesLink\" data-overlay=\"overlay-purc-fareRules\"{{param0}}>票价规定</a>和<a href=\"{{param1}}\"{{param2}}>运输条件。</a>", "object-key-init"),
