    "PURC.text.TermsAndCondition.HaveReadAll_New": cc11001100_hook("PURC.text.TermsAndCondition.HaveReadAll_New", "我已阅读并同意所有<a class=\"ribe-link-in-para\" href=\"http://www.cathaypacific.com/cx/sc_CN/hidden-pages/pop-up/ibe/terms-and-conditions.html\" target=\"_blank\">条款及细则<img src=\"https://www.cathaypacific.com/content/dam/system-folder/cx/en_HK/images/global/open-a-new-window.png\" alt=\"条款及细则, opens in a new window\"></a>，<a href=''javascript:void(0)'' tabindex=\"0\" class=\"overlayLink fareRulesLink ribe-link-in-para\" data-overlay=\"{{param0}}\">票价规定</a>及<a class=\"\"ribe-link-in-para\"\" href=\" https://www.cathaypacific.com/content/dam/cx/legal-and-privacy/general-conditions-of-carriage-for-passengers-baggage-sc.pdf\" target=\"_blank\">载运条件及规例</a><img src=\"https://www.cathaypacific.com/content/dam/system-folder/cx/en_HK/images/global/open-a-new-window.png\" alt=\"载运条件及规例, opens in a new window\"></a>。", "object-key-init"),
    "PURC.text.TermsAndCondition.Heading": cc11001100_hook("PURC.text.TermsAndCondition.Heading", "通用条款及细则、支付卡和预订信息", "object-key-init"),
