    "PURC.text.TermsAndCondition.IAgree": cc11001100_hook("PURC.text.TermsAndCondition.IAgree", "我同意通过国泰航空公司网站进行网上购票相关的<a class=\"ribe-link-in-para\" href=\"http://www.cathaypacific.com/cx/sc_CN/hidden-pages/pop-up/ibe/terms-and-conditions.html\" target=\"_blank\">条款及细则<img src=\"https://www.cathaypacific.com/content/dam/system-folder/cx/en_HK/images/global/open-a-new-window.png\" alt=\"条款及细则，网站在新窗口中打开\"></a>，并同意在购票过程中，我与香港国际机场国泰城的国泰航空公司签订合同。", "object-key-init"),
    "PURC.text.TermsAndCondition.IAgree.link": cc11001100_hook("PURC.text.TermsAndCondition.IAgree.link", "http://www.cathaypacific.com/cx/sc_CN/hidden-pages/pop-up/ibe/terms-and-conditions.html", "object-key-init"),
    "PURC.text.TermsAndCondition.LiabilityBaggage": cc11001100_hook("PURC.text.TermsAndCondition.LiabilityBaggage", "我同意<a class=\"ribe-link-in-para\" href=\"https://www.cathaypacific.com/content/dam/cx/legal-and-privacy/CX-ET-Conditions-of-Contracts-Notices.pdf\" target=\"_blank\">航空公司对于旅客及其行李的责任<img src=\"https://www.cathaypacific.com/content/dam/system-folder/cx/en_HK/images/global/open-a-new-window.png\" alt=\"航空公司对于旅客及其行李的责任，网站在新窗口中打开\"></a>声明。", "object-key-init"),
    "PURC.text.TermsAndCondition.LiabilityBaggage.link": cc11001100_hook("PURC.text.TermsAndCondition.LiabilityBaggage.link", "https://www.cathaypacific.com/content/dam/cx/legal-and-privacy/CX-ET-Conditions-of-Contracts-Notices.pdf", "object-key-init"),
    "PURC.text.TermsAndCondition.LithiumInBaggage": cc11001100_hook("PURC.text.TermsAndCondition.LithiumInBaggage", "我同意遵守<a class=\"ribe-link-in-para\" href=\"http://www.cathaypacific.com/cx/sc_CN/travel-information/baggage/controlled-and-banned-items/lithium-batteries.html\" target=\"_blank\">行李中携带锂电池<img src=\"https://www.cathaypacific.com/content/dam/system-folder/cx/en_HK/images/global/open-a-new-window.png\" alt=\"行李中携带锂电池，网站在新窗口中打开\"></a>的限制条款。", "object-key-init"),
    "PURC.text.TermsAndCondition.LithiumInBaggage.link": cc11001100_hook("PURC.text.TermsAndCondition.LithiumInBaggage.link", "http://www.cathaypacific.com/cx/sc_CN/travel-information/baggage/restricted-items/batteries.html", "object-key-init"),
    "PURC.text.TermsAndCondition.PaymentCard.Body": cc11001100_hook("PURC.text.TermsAndCondition.PaymentCard.Body", "如果你要预订航班或航班相关服务，请参阅以下条款及细则。持卡人不需要为预订及乘搭航班的人士。如果使用 Visa 验证服务、万事达卡 SecureCode、美国运通 SafeKeyxAE、J/Secure™ 或 ProtectBuy 成功完成交易，持卡人将不必出示该卡以作核实。然而，国泰航空保留要求出示该信用卡以作核实的权利。<br><br> \n我明白如信用卡持有人或网上信用卡使用者未能于旅客办理登机手续或领取机票时出示订票时所用之信用卡，航空公司将有权拒绝让该旅客登机，或要求收取保证金（只收现金或以另一信用卡支付）。", "object-key-init"),
    "PURC.text.TermsAndCondition.PaymentCard.Heading": cc11001100_hook("PURC.text.TermsAndCondition.PaymentCard.Heading", "支付卡", "object-key-init"),
    "PURC.text.TermsAndCondition.ProhibitedMaterials": cc11001100_hook("PURC.text.TermsAndCondition.ProhibitedMaterials", "我确认我已阅读并理解 <a class=\"ribe-link-in-para\" href=\"http://www.cathaypacific.com/cx/sc_CN/travel-information/baggage/restricted-items/prohibited-items.html\" target=\"_blank\">关于行李禁运物品的限制规定<img src=\"https://www.cathaypacific.com/content/dam/system-folder/cx/en_HK/images/global/open-a-new-window.png\" alt=\"关于行李禁运物品的限制规定，网站在新窗口中打开\"></a>。", "object-key-init"),
    "PURC.text.TermsAndCondition.ReadCollapse": cc11001100_hook("PURC.text.TermsAndCondition.ReadCollapse", "隐藏条款及细则", "object-key-init"),
    "PURC.text.TermsAndCondition.ReadExpand": cc11001100_hook("PURC.text.TermsAndCondition.ReadExpand", "显示条款及细则", "object-key-init"),
    "PURC.text.TermsAndCondition.SecurityPolicy": cc11001100_hook("PURC.text.TermsAndCondition.SecurityPolicy", "我确认我已阅读并了解国泰航空公司隐私政策，并同意<a class=\"ribe-link-in-para\" href=\"http://www.cathaypacific.com/cx/sc_CN/legal-and-privacy.html\" target=\"_blank\">数据隐私和安全政策<img src=\"https://www.cathaypacific.com/content/dam/system-folder/cx/en_HK/images/global/open-a-new-window.png\" alt=\"数据隐私和安全政策\"></a>所述有关我的个人资料的收集、处理、使用、存储、获取和传输。", "object-key-init"),
    "PURC.text.TermsAndCondition.SubHeading": cc11001100_hook("PURC.text.TermsAndCondition.SubHeading", "通用条款及细则", "object-key-init"),
    "PURC.text.TermsAndCondition.TotalText": cc11001100_hook("PURC.text.TermsAndCondition.TotalText", "合计", "object-key-init"),
    "PURC.text.TermsAndCondition.TWDRoute": cc11001100_hook("PURC.text.TermsAndCondition.TWDRoute", "此交易由境外银行刷卡收单，属”境外交易”，信用卡发卡银行可能须要收取国际交易费用。", "object-key-init"),
    "PURC.text.tnc.TrainSegment": cc11001100_hook("PURC.text.tnc.TrainSegment", "本行程\"铁路+航空”的非航空交通部分由德国铁路公司运营提供。国泰航空作为运营商的代理机构。因此，将根据铁路交通适用于<a href=\"https://www.bahn.com/en/view/booking-information/passenger-rights/passenger-rights-in-rail-transport.shtml \"target=\"_blank\">铁路交通法规</a>。", "object-key-init"),
    "PURC.text.tnc.TrainSegment.Neo": cc11001100_hook("PURC.text.tnc.TrainSegment.Neo", "本行程“铁路+航空”的非航空交通部分由德国铁路公司运营提供。国泰航空作为运营商的代理机构。因此，<a class=\"ribe-link-in-para\" href=\"https://www.bahn.com/en/view/booking-information/passenger-rights/passenger-rights-in-rail-transport.shtml \"target=\"_blank\">铁路交通法规<img src=\"https://www.cathaypacific.com/content/dam/system-folder/cx/en_HK/images/global/open-a-new-window.png\" alt=\"铁路交通法规，网站在新窗口中打开\"></a>适用于根据铁路交通部分。", "object-key-init"),
    "PURC.text.tnc.USMarket": cc11001100_hook("PURC.text.tnc.USMarket", "尽管违背于任何预订条款细则或票价规则，通过美国网站在线预订7天或以后的航班，无论行程涉及任何地方，您均可以在付款之后的24小时内取消预订，并根据我们在<a class=\"ribe-link-in-para\" href=\"http://www.cathaypacific.com/cx/sc_CN/about-us/contact-us/faqs/manage-booking/changes-cancellation-refund.html\" target=\"_blank\">更改、取消和退款</a>中的退款流程退还全部款项。", "object-key-init"),
