    "PURC.text.wechat.CNY": cc11001100_hook("PURC.text.wechat.CNY", "如要使用微信付款，你的账户必须关联中国内地钱包，并以中国居民身份证验证身份。", "object-key-init"),
    "PURC.text.wechat.ExternalPaymentMessage1": cc11001100_hook("PURC.text.wechat.ExternalPaymentMessage1", "我们将重新指引您前往外部付款页面，请点击下方\"继续付款\"键完成您的交易。", "object-key-init"),
    "PURC.text.wechat.ExternalPaymentMessage2": cc11001100_hook("PURC.text.wechat.ExternalPaymentMessage2", "为确保交易成功，您的微信钱包必须绑定一张中国内地银行签发的银行卡。<p>請注意，您必須先同意有關條款及細則，然後才可繼續。<p> 您必须在10分钟内完成付款。付款时请不要关闭浏览器，因为一旦您的交易被接纳，我们会将您重新导向至您的预订确认页面。", "object-key-init"),
    "PURC.text.wechat.ExternalPaymentMessage3": cc11001100_hook("PURC.text.wechat.ExternalPaymentMessage3", "在手机或平板设备打开微信应用程序，并选择“扫描二维码”。你的账户必须关联中国内地钱包，并以中国居民身份证验证身份，方可进行付款。", "object-key-init"),
